import { useEffect, useState } from "react";
import { Link } from "react-router-dom";



function Ecomdata() {

    const [data, setData] = useState([])

    useEffect(() => {

        fetch("http://localhost:3005/E-commerce")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                console.log(resp)

                setData(resp)
            })
    }, [])

    return (

        <div className="container-fluid">

            <div id="logout">
                <Link to='/Signout' id="link">Logout</Link>

            </div>
            <div>
                {data.map((item) => (
                    <div>
                        <p><img src={item.image} style={{ width: "200px", height: "200px" }} /> </p>
                        <h3>{item.brand}</h3>
                        <p>{item.name}</p>
                        <p>{item.price}</p>
                    </div>

                ))}

            </div>

        </div>
    )

}
export default Ecomdata;
